import React from 'react'

import MobileHeader from './MobileHeader.js'

class MobileApp extends React.Component {
  render() {

    return (
      <React.Fragment>
        <MobileHeader />
        <embed src="https://www.sawasdeesoquel.com/menus/LunchEmbeded.pdf"  width="100%"/>
      </React.Fragment>
    )
  }
}
export default MobileApp

